import MenuAccount from "./MenuAccount";

function Account(){
    // <MenuAccount />
    return(
		<div class="container">
			<div class="row">
				<div class="col-sm-3">
					<div class="left-sidebar">
						<h2>Account</h2>
						{<MenuAccount />}
					
						
					</div>
				</div>
				<div class="col-sm-9">
					<div class="blog-post-area">
						<h2 class="title text-center">Update user</h2>
						 {<Account />}
					</div>
				</div>
			</div>
		</div>
	
    )
}
export default Account;
